import React, { useEffect } from "react";
import axios from "axios";

function Gallery() {
  const URL =
    "https://api.airtable.com/v0/appgSipibWEhbQcAf/userEdits?filterByFormula=(%7BimageID%7D%3D%22%22recogH9MefyNngjMB%22%22)";

  const query = { params: { filterByFormula: '({notes}="xzcz")' } };
  useEffect(() => {
    const getImg = async () => {
      const data = await axios.get(URL, {
        headers: {
          Authorization: `Bearer ${process.env.REACT_APP_AIRTABLE_KEY}`,
        },
      });
      console.log(data);
    };
    getImg();
  }, []);

  return <div></div>;
}

export default Gallery;
